filterCargoSources :: path -> string -> bool A source filter which when used with cleanSourceWith (from nixpkgs's lib) will retain the following files from a given source: Cargo files (Cargo.toml, Cargo.lock, .cargo/config.toml, .cargo/config) Rust files (files whose name end with .rs) TOML files (files whose name end with .toml) cleanSourceWith { src = ./.; filter = lib.filterCargoSources;
} Note that it is possible to compose source filters, especially if filterCargoSources omits files which are relevant to the build. For example: let # Only keeps markdown files markdownFilter = path: _type: builtins.match ".*md$" path != null; markdownOrCargo = path: type: (markdownFilter path type) || (lib.filterCargoSources path type);
in
cleanSourceWith { src = ./.; filter = markdownOrCargo;
}

