registryFromDownloadUrl :: set -> set Prepares a crate registry into a format that can be passed directly to appendCrateRegistries using the registry's download URL. If the registry in question has a stable download URL (which either never changes, or it does so very infrequently), then registryFromDownloadUrl is a great and lightweight choice for including the registry. To get started, look up the config.json at the registry's root and copy the value of the dl entry. If the registry's download endpoint changes more frequently and you would like to infer the configuration directly from a git revision, consider using registryFromGitIndex as an alternative. If the registry needs a special way of accessing crate sources the fetchurlExtraArgs set can be used to influence the behavior of fetching the crate sources (e.g. by setting curlOptsList) Required attributes dl: the value of the dl entry in the registry's config.json file indexUrl: an HTTP URL to the index Optional attributes fetchurlExtraArgs: a set of arguments which will be passed on to the fetchurl for each crate being sourced from this registry lib.registryFromDownloadUrl { dl = "https://crates.io/api/v1/crates"; indexUrl = "https://github.com/rust-lang/crates.io-index";
}
